/**
 * Created by Lenovo on 2019/8/10.
 */
import React from 'react';
import '../share.css';
export default class List extends React.Component {
    render(){
        const {leftIcon,leftTitle,rightTitle,rightIcon} = this.props;
        console.log(leftIcon);
        return(
            <div className="cm-item cm-jc-sb">
            <div className="cm-flex cm-ai-c">
                {leftIcon?<img src={leftIcon} alt="" className="cm-img-small-icon"/>:null}
                <span className="cm-c-333 cm-ml-05">{leftTitle}</span>
            </div>
            <div className="cm-flex cm-ai-c"><span className="cm-c-999">{rightTitle}</span>
                {rightIcon?<img src={rightIcon} alt="" className="cm-img-small-icon"/>:null}
            </div>
        </div>
        )
    }
}
